import { productos } from "../assets/imagenes/apis/data"
import {Swiper, SwiperSlide } from "swiper/modules";
import { Navigation, Pagination } from "swiper/modules";
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";

export default function NewArrivals() {

  return (
    <article className="art-newArrivals">
      <h2>Nuevo Ingreso</h2>
      <div className="">
        <div className="box-tarjetas-newArrivals">
          {productos.map((item, index) => (
          <div key={index} className="tarjeta-newArrivals">
            <div className="box-img-newArrivals">
              <img src={item.imagen} alt={item.nombre}/>
            </div>
            <div className="box-tex-newArrivals">
              <h2>{item.nombre}</h2>
              <p>{item.descripcion}</p>
              <span><b>Q{item.precio.toFixed(2)}</b></span>
            </div>
          </div>
          ))}
        </div>
      </div>
      <button>Ver mas</button>
    </article>
  )
}
